import React from 'react';
import TodoList from './TodoList';
import './index.css'

function App() {
  return (
    <>
    <a href="https://youtu.be/hQAHSlTtcmY?t=544">https://youtu.be/hQAHSlTtcmY?t=544</a>
    <TodoList/>
    <input type="text"/>
    <button>add todo</button>
    <button>clear todo</button>
    <div>0 left to do</div>
    </>
  )
}

export default App;
